import { Link } from 'react-router-dom';

import classes from './MainNavigation.module.css'
import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import TreeView from '@material-ui/lab/TreeView';
import ExpandMoreIcon from '@material-ui/icons/ExpandMore';
import ChevronRightIcon from '@material-ui/icons/ChevronRight';
import TreeItem from '@material-ui/lab/TreeItem';

const useStyles = makeStyles({
  root: {
    height: 216,
    flexGrow: 1,
    maxWidth: 400,
  },
});

export default function MainNavigation() {
  const classes = useStyles();

  return (
    <div><h2>Navigation</h2>
    <TreeView
      className={classes.root}
      defaultCollapseIcon={<ExpandMoreIcon />}
      defaultExpandIcon={<ChevronRightIcon />}
      multiSelect
    >
      <TreeItem nodeId="1" label="Pages">
        <Link to='/'>All Meetups</Link>
        <TreeItem nodeId="3" label="Chrome"><Link to='/new-meetup'>Create New Meetup</Link></TreeItem>
        <TreeItem nodeId="4" label="Webstorm"><Link to='/favorites'>Favorites</Link></TreeItem>
      </TreeItem>
    </TreeView>
    </div>
  );
}
